package com.gmail.samuelhermosilla98.gamestoreapp.Models;

import org.junit.Before;
import org.junit.Test;

import java.util.regex.Matcher;
import java.util.regex.Pattern;

import static org.junit.Assert.*;

public class JuegoTest {

    //Definimos unas variables estáticas para asociarselas al juego.
    private Juego myJg;
    private static final Integer ID = 1;
    private static final String NOMBRE = "Nostale";
    private static final Integer PRECIO = 10;
    private static final String FECHA = "08/04/2011";
    private static final String IMAGEN = "";


    //Creamos un método que se ejecutará antes que los Tests
    @Before
    public void setUp(){
        myJg = new Juego(ID, NOMBRE, PRECIO, FECHA, IMAGEN);
    }

    //Probamos que el juego ejecutado anteriormente no sea null
    @Test
    public void JuegoNotNull(){
        assertNotNull(myJg);
    }


    //Comprobaremos si el valor de las constantes establecidas arriba son igual que las que obtenemos del objeto myJg.
    @Test
    public void getId() {
        assertEquals(ID,myJg.getId());
    }


    @Test
    public void getNombre() {
        assertEquals(NOMBRE,myJg.getNombre());
    }

    @Test
    public void getPrecio() {
        assertEquals(PRECIO,myJg.getPrecio());
    }

    @Test
    public void getFecha() {
        assertEquals(FECHA,myJg.getFecha());
    }

    @Test
    public void getImagen() {
        assertEquals(IMAGEN,myJg.getImagen());
    }



    //Y ahora comprobamos los Setters donde si el valor no es nullo, lo seteamos al objeto.
    @Test
    public void setId(){
        Integer newId=1;
        if(newId != null){
            assertTrue("true",myJg.setId(newId));
        }else{
            assertFalse("false",myJg.setId(newId));
        }
    }

    @Test
    public void setNombre(){
        String newNombre="Borderlands";
        String stringPattern= "^[a-zA-Z ]*$";
        Pattern pattern = Pattern.compile(stringPattern);
        Matcher matcher = pattern.matcher(newNombre);
        if(matcher.matches()){
            assertTrue("true",myJg.setNombre(newNombre));
        }else{
            assertFalse("false",myJg.setNombre(newNombre));
        }
    }

    @Test
    public void setPrecio(){
        Integer newPrecio = 49;
        if(newPrecio != null){
            assertTrue("true",myJg.setPrecio(newPrecio));
        }else{
            assertFalse("false",myJg.setPrecio(newPrecio));
        }
    }

    @Test
    public void setFecha(){
        String newFecha = "22/10/2019";
        String fecPattern="^((([0][1-9]|[12][0-9]|3[01])(\\/|\\-)([0][13-9]|[1][0-2]))|(([0][1-9]|[12][0-9])(\\/|\\-)02))(\\/|\\-)(\\d{4})";
        Pattern pattern = Pattern.compile(fecPattern);
        Matcher matcher = pattern.matcher(newFecha);
        if(matcher.matches()){
            assertTrue("true",myJg.setFecha(newFecha));
        }else{
            assertFalse("false",myJg.setFecha(newFecha));
        }
    }

    @Test
    public void setImagen(){
        String newImagen = "";
        if(newImagen != null){
            assertTrue("true",myJg.setImagen(newImagen));
        }else{
            assertFalse("false",myJg.setImagen(newImagen));
        }
    }



}